query PageById(
  $id: String!
) {
  wordpressPage(id: {eq: $id}) {
    title
    content
  }
}

query BlogPostByID(
  $id: String!
) {
  wordpressPost(id: {eq: $id}) {
    id
    title
    slug
    content
    date(formatString: "MMMM DD, YYYY")
    categories {
      name
      slug
    }
    tags {
      name
      slug
    }
    author {
      name
      slug
    }
  }
}

query IndexQuery(
  $limit: Int!
  $skip: Int!
) {
  allWordpressPost(sort: {fields: date, order: DESC}, limit: $limit, skip: $skip) {
    edges {
      node {
        ...PostListFields
      }
    }
  }
}

fragment PostListFields on wordpress__POST {
  id
  title
  excerpt
  author {
    name
    slug
    avatar_urls {
      wordpress_48
    }
  }
  date(formatString: "MMMM DD, YYYY")
  slug
}

query CategoryPage(
  $slug: String!
) {
  site {
    siteMetadata {
      title
    }
  }
  allWordpressPost(filter: {categories: {slug: {eq: $slug}}}) {
    totalCount
    edges {
      node {
        ...PostListFields
      }
    }
  }
}

